771239355595","edge_media_to_caption":{"edges":[{"node":{"text":"A menina - s\u00f3 ela precisa de mais uma fase nesse processo formativo do eu. N\u00e3o s\u00f3 pede que a m\u00e3e veja seu corpo, mas que o veja e reconhe\u00e7a como corpo feminino: \"o corpo que vejo no olhar de minha m\u00e3e \u00e9 o de uma menina\". Com esta imagem legitimada pela m\u00e3e, a menina adquire uma matriz n\u00e3o s\u00f3 de seu \"eu\", mas de seu \"eu feminino\". \n\nA resposta materna \u00e0 demanda da menina de aceita\u00e7\u00e3o de seu corpo depende de ela ter resolvido as quest\u00f5es com o pr\u00f3prio corpo e com o sentimento de feminilidade a ele associado. Em fun\u00e7\u00e3o da forma como se deu esta resolu\u00e7\u00e3o subjetiva, a m\u00e3e pode olhar e ver ou n\u00e3o ver o corpo da filha como tal. \n\nAs m\u00e3es, de forma geral, s\u00e3o s\u00e1bias. Embora o capricho com as roupas de seus filhos possa ser o mesmo, elas tendem a vestir os meninos e a enfeitar as meninas. Elas sabem que o corpo feminino precisa de enfeites, de artif\u00edcios, de adere\u00e7os que, tanto quanto o amor, recobrem o vazio do qual a menina, futura mulher, se res sente desde pequena. \n\nH\u00e1 m\u00e3es que o intuem t\u00e3o profundamente que, ao se saberem gr\u00e1vidas de uma menina, se dedicam ao enxoval desta com apuro especial, esbo\u00e7ando algum investimento antecipado no corpo feminino da menininha ainda por nascer. \n\nFonte: De menina a mulher \u2013 Malvine Zalcberg \u2013 pg.19 - 20\n\nFoto/Reprodu\u00e7\u00e3o: beyonce.com (Beyonce \u0026 Blue Ivy)\n\n#psicanalise #psicanaliseclinica #freud #lacan #egolab #egolaboficial #sigmundfreud #jacqueslacan #psicanalista #psican\u00e1lise #freudexplica #feminino #beyonce"}}]},"shortcode":"CfMQE8bsTTL","edge_media_to_comment":{"count":5},"taken_at_timestamp":1656082832,"dimensions":{"height":1350,"width":1080},"display_url":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/289376712_564925065156306_6902909254836029825_n.jpg?stp